import './ExpenseItem.css'
const ExpenseItem = () => {
    return (
        <div>
            <div>Sep 28th 2021</div>
            
            <h2>Car Insurance</h2>
            <div>$237.82</div>
        </div>
    )
}

export default ExpenseItem
